import React from "react";
import PropTypes from "prop-types";

/**
 * @description - Body Component.
 * @returns {Node} - Body View Component
 */
const Body = ({ children }) => {
  const open = () => {
    alert("You clicked this container component");
  };

  return <div onClick={open}>{children}</div>;
};

Body.propTypes = {};

export default Body;
